import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import heroImg from "../assets/12.jpg";

function Home() {
  return (
    <>
      <Navbar />
      <Hero
        cName="hero"
        heroImg={heroImg}
        title="Your Journey Your Story"
        text="Choose Your Favourite Destination."
        buttonText="Travel PLan"
        url="/"
        btnClass="show"
      />
    </>
  );
}

export default Home;
